window.bookSummaryJSON = "<p>For Raven Black, hunting criminals is second nature. So is denial. It's not easy moving forward with one foot stuck in the past. But a new case offers her a much-needed distraction when Keystone accepts their toughest assignment yet - to track down an elusive criminal who's selling children on the black market. </p> <p>Their investigation leads them deep into the underbelly of the Breed world, a place both treacherous and enticing. With no room for mistakes, Raven makes a tough decision to lock the door to her past before it interferes with her job. The only trouble? Christian holds the key. </p> <p>The stakes are high, and a shocking twist turns everything on its head. Will they catch this criminal before more lives are lost? Find out in the latest edge-of-your-seat installment of the Crossbreed series. </p>"; 
